import "./Page.css";

class Page extends Component {
  render() {
    return (
      <div>
        <div class="sidenav">
          <li>MY MOVES</li>
          <li>MY PROFILE</li>
          <li>GET QUOTES</li>
          <li>LOGOUT</li>

        </div>
      </div>
    );
  }
}

export default Page;
